description.text:
Holds a GoPro Hero3 in place for those rugged situations when a friction bolt just won't do!  
To make this as strong as possible, my design philosophy was &quot;starting from a solid block, what's the minimal amount I have to remove to mount a GoPro?&quot;  
Meant to be used as a base part--either cut holes in the model to strap it on, or else included as part of a larger mount model.  OpenSCAD source files are included.
